    false,nt"url": null,nt"notes": "Biological, chemical, geological, and other
    data were collected from the R/V Kittiwait from 01 June 1998 to 01 July 1998. Data
    were submitted by the Washington State Department of Ecology (WADOE) as part of
    a 3 year, 100 site, study of toxins in the Puget Sound. Biological data include
    infauna surveys, amphipod bioassays, and percent urchin fertilization. Chemical
    data include results of tests for toxins by cytochrome and microtoxology. Geological
    data include determination of grain fractions.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
